import React from "react";
import { GiHamburgerMenu } from "react-icons/gi";

import {
  ComponentContainer,
  HamburgerButtonTextContainer,
} from "./hamburger-button.styles";

const HamburgerButton = (props) => {
  return (
    <ComponentContainer
      className="hamburger__button"
      onClick={props.click}
    >
      <GiHamburgerMenu size={20} />
      <HamburgerButtonTextContainer className="hamburger__text">
        All
      </HamburgerButtonTextContainer>
    </ComponentContainer>
  );
};

export default HamburgerButton;
